import React, { useState,  useEffect} from "react";
import axios from "axios";
import "../styles/Carte.css";

const Carte = ({profil}) => {
    return (
      <div className='carte'>
        <div className="descri" key={profil.id}>
              <img src={`http://localhost:/${profil.image}`}alt="tete"/>
              <div className="name">{profil.name}</div>
              <div className="gabarit">{profil.gabarit}{profil.type}</div>
              <div className="age">{profil.age}</div>
          </div>
      </div>
)}

export default Carte;
